import React from 'react'
const Createpost = () => {
    return ( 
        <div className="card" style={{margin:"10px auto",maxWidth:"600px",padding:"20px"}}>
            <input type="text" placeholder="title" />
            <input type="text" placeholder="body" />
            <div className="file-field input-field">
            <div className="btn">
                  <span>File</span>
                      <input type="file" />
          </div>
            <div className="file-path-wrapper">
                <input className="file-path validate" type="text" placeholder="upload image"/>
                <button className="btn waves-effect waves-light" >Submit post</button>
             </div>
          </div>
        </div>
     );
}
 
export default Createpost;
